# Remove unnecessary variables

variables <- c("ExpCondition", "sex", "age", "education", "interestInPolitics", "q1", "q2", "q3", "q4", "q5", "q6", "q7", "q8", "q9", "q10", "q11", "q12", "q13", "q14", "q15", "q16", "q17", "q18","q19","q20","q21","q22","q23","q24","q25")
netherlands <- netherlands[variables]
netherlands$sex[netherlands$sex == 3] <- NA
netherlands$sex[netherlands$sex == 1] <- 0
netherlands$sex[netherlands$sex == 2] <- 1
netherlands[netherlands == -999|netherlands == -998|netherlands == -997|netherlands == -996|netherlands == -995] <- NA
netherlands <- na.omit(netherlands)

netherlands$ExpCondition <- recode(netherlands$ExpCondition, "1='0'; 2='1'")
netherlands$ExpCondition <- as.factor(netherlands$ExpCondition)

# Check equality

chisq.test(netherlands$ExpCondition, netherlands$sex)
t.test(netherlands$age~netherlands$ExpCondition)
kruskal.test(netherlands$interestInPolitics,netherlands$ExpCondition)
kruskal.test(netherlands$education,netherlands$ExpCondition)
aggregate(netherlands$interestInPolitics, by=list(netherlands$ExpCondition), FUN=mean)[2]

# Gutmann errors

netherlands_exp0 <- subset(netherlands,ExpCondition==0)
netherlands_exp1 <- subset(netherlands,ExpCondition==1)

netherlands_exp0 <- subset(netherlands_exp0,select= c(q3,q4,q9,q11,q12,q13,q14,q19,q25))
netherlands_exp1 <- subset(netherlands_exp1,select= c(q2,q3,q9,q11,q12,q13,q14,q19,q25))

netherlands_exp0$q4 <- recode(netherlands_exp0$q4, "5='1'; 4='2'; 3='3'; 2='4'; 1='5'")
netherlands_exp0$q9 <- recode(netherlands_exp0$q9, "5='1'; 4='2'; 3='3'; 2='4'; 1='5'")
netherlands_exp0$q13 <- recode(netherlands_exp0$q13, "5='1'; 4='2'; 3='3'; 2='4'; 1='5'")
netherlands_exp0$q19 <- recode(netherlands_exp0$q19, "5='1'; 4='2'; 3='3'; 2='4'; 1='5'")

netherlands_exp1$q9 <- recode(netherlands_exp1$q9, "5='1'; 4='2'; 3='3'; 2='4'; 1='5'")
netherlands_exp1$q13 <- recode(netherlands_exp1$q13, "5='1'; 4='2'; 3='3'; 2='4'; 1='5'")
netherlands_exp1$q19 <- recode(netherlands_exp1$q19, "5='1'; 4='2'; 3='3'; 2='4'; 1='5'")

netherlands_exp0<- as.matrix(netherlands_exp0)
netherlands_exp1<- as.matrix(netherlands_exp1)

gutmann_exp0 <-guttmanErrors(netherlands_exp0)
gutmann_exp1 <-guttmanErrors(netherlands_exp1)

gutmann <- c(gutmann_exp0,gutmann_exp1)
netherlands <- cbind(netherlands, gutmann)

ddply(netherlands, "ExpCondition", summarise, grp.mean=mean(gutmann))
ddply(netherlands, "ExpCondition", summarise, grp.mean=sd(gutmann))
t.test(netherlands$gutmann~netherlands$ExpCondition)

write.csv(netherlands, file = "netherlands.csv")

rm(netherlands_exp1,netherlands_exp0,gutmann,gutmann_exp1,gutmann_exp0,GCtorture,variables)

