  if(length(array1)!=length(array2)){
    NA
  }else{
    coeff<-0;
    counter<-0;
    for(i in 1:length(array1)){
      if(array1[i]>ignoreValueAbove) next;
      if(array2[i]>ignoreValueAbove) { counter <- counter+1; next;}
      coeff <- coeff+(coeffMatrixEuclid[array1[i],array2[i]]);
      counter <- counter+1;
    }
    coeff/counter;
  }
};

